(()=>{const link=document.createElement("link");link.rel="stylesheet",link.href="/css/app.css",document.head.appendChild(link);const ancor=document.querySelectorAll("a");ancor.forEach(link=>{link.addEventListener("click",evt=>{evt.preventDefault();const target=evt.target.getAttribute("data-target"),app=document.querySelector("#app");loadPage(target)})}),setInterval(()=>{},1e3)})();const loadPage=page=>{fetch(`/../${page}.tpl`).then(r=>r.text()).then(r=>app.innerHTML=r)};loadPage("inicio");